<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Animeverse Esports Team Info</title>
    <style>
    body {
        font-family: Arial, sans-serif;
        background: url('https://w0.peakpx.com/wallpaper/300/613/HD-wallpaper-bgmi-trending-pubg-bgmi-iammsa-pubg-thumbnail.jpg') no-repeat center center fixed;
        background-size: cover;
        color: #f4f4f4;
        margin: 0;
        padding: 0;
    }

    header {
        background-color: rgba(51, 51, 51, 0.8);
        color: #fff;
        padding: 20px;
        text-align: center;
    }

    main {
        padding: 20px;
        text-align: center;
    }

    h1 {
        color: red;
        font-size: 60px;
    }

    h2 {
        color: red;
        font-size: 30px;
    }

    .hero-text h1 {
        font-size: 5em;
        margin: 0;
    }

    .hero-text h2 {
        font-size: 2em;
        margin: 0;
    }

    footer {
        background-color: rgba(51, 51, 51, 0.8);
        color: #fff;
        text-align: center;
        padding: 10px;
        width: 100%;
        bottom: 0;
    }

    .button {
        background-color: #ff4500;
        color: white;
        padding: 15px 25px;
        text-align: center;
        text-decoration: none;
        display: inline-block;
        font-size: 16px;
        margin: 10px 2px;
        cursor: pointer;
    }

    .button:hover {
        background-color: #ff6347;
    }

    .team-info {
        max-width: 1200px;
        margin: 0 auto;
        padding: 20px;
        background-color: rgba(0, 0, 0, 0);
        color: white;
        border-radius: 10px;
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        gap: 20px;
    }

    .team-info h2 {
        grid-column: span 4;
        text-align: center;
    }

    .team-member {
        text-align: center;
        background-color: rgba(0, 0, 0, 0.1);
        color: white;
        padding: 10px;
        border-radius: 10px;
    }

    .team-member img {
        width: 100%;
        height: 200px;
        border-radius: 10px;
        object-fit: cover;
    }

    .team-member h3 {
        margin: 10px 0 0 0;
    }

    .team-member p {
        margin: 5px 0;
    }

    @media (max-width: 1200px) {
        .team-info {
            grid-template-columns: repeat(3, 1fr);
        }
    }

    @media (max-width: 900px) {
        .team-info {
            grid-template-columns: repeat(2, 1fr);
        }
    }

    @media (max-width: 600px) {
        .team-info {
            grid-template-columns: 1fr;
        }
    }

    @media (max-width: 750px) {
        .hero-text h1 {
            font-size: 2.5em;
        }

        .hero-text h2 {
            font-size: 1.5em;
        }

        .team-info {
            width: 100%;
            padding: 15px;
        }

        .team-member img {
            height: 150px;
        }
    }

    @media (max-width: 480px) {
        .hero-text h1 {
            font-size: 2em;
        }

        .hero-text h2 {
            font-size: 1.2em;
        }

        .button {
            padding: 10px 20px;
            font-size: 14px;
        }
    }
    </style>
</head>

<body>
    <header>
        <h1>Animeverse Esports Team</h1>
        <h2>Our Bgmi Team</h2>
    </header>

    <main>
        <div class="hero">
            <section class="team-info">
                <div class="team-member">
                    <img src="https://c4.wallpaperflare.com/wallpaper/622/941/214/jujutsu-kaisen-satoru-gojo-hd-wallpaper-preview.jpg"
                        alt="Player 1 Image">

                    <h3>Player 1: AVxGOJO</h3>
                    <p>UID : </p>
                    <p>Role: Team Leader / IGL</p>
                </div>
                <div class="team-member">
                    <img src="https://c4.wallpaperflare.com/wallpaper/100/696/960/yuji-itadori-jujutsu-kaisen-sukuna-hd-wallpaper-preview.jpg"
                        alt="Player 2 Image">
                    <h3>Player 2: AVxYUJI</h3>
                    <p>UID : </p>

                    <p>Role: Support / Strategist</p>
                </div>
                <div class="team-member">
                    <img src="data:image/jpeg;base64,"
                        alt="Player 3 Image">
                    <h3>Player 3: AVxNANAMI</h3>
                    <p>UID : </p>

                    <p>Role: Assault / Entry Fragger</p>
                </div>
                <div class="team-member">
                    <img src="https://wallpapers.com/images/high/anime-naruto-hitsuji-hand-signal-aozcdz115sdggs9m.webp"
                        alt="Player 4 Image">
                    <h3>Player 4: AVxNARUTO</h3>
                    <p>UID : </p>
                    <p>Role: Scout / Sniper</p>
                </div>
                <div class="team-member">
                    <img src="data:image/jpeg;base64,"
                        alt="Player 5 Image">
                    <h3>Player 5: AVxYUTA</h3>
                    <p>UID : </p>
                    <p>Role: Assault / Fragger</p>
                </div>
                <div class="team-member">
                    <img src="data:image/jpeg;base64,"
                        alt="Player 6 Image">
                    <h3>Player 6: AVxOBITO</h3>
                    <p>UID : </p>
                    <p>Role: Support</p>
                </div>
                <div class="team-member">
                    <img src="data:image/jpeg;base64,"
                        alt="Player 7 Image">
                    <h3>Player 7: AVxTOJI</h3>
                    <p>UID : </p>
                    <p>Role: Support</p>
                </div>
            </section>
        </div>
    </main>
    <footer>
        <p>&copy; 2024 Animeverse Esports. All rights reserved.</p>
    </footer>
</body>

</html>